import React, { Component } from 'react'
import { Text, View } from 'react-native'

function Disciplina() {
    return (
        <View>
            <Text style={{ fontSize: 24, fontWeight: 'bold' }}>
                {this.props.disciplina}
            </Text>
        </View>
    )
}

export default Disciplina
